import React from 'react';
import { NavLink } from 'react-router-dom';
import './sidebar.css';

function Sidebar() {
  return (
    <aside className="sidebar">
      <div className="logo">
        <img src="logo.png" alt="Logo" />
        <span>Smart Storage</span>
      </div>
      <nav className="menu">
        <ul>
          <li><NavLink to="/overview" activeClassName="active">Dashboard</NavLink></li>
          <li><NavLink to="/storage" activeClassName="active">Storage</NavLink></li>
          <li><NavLink to="/reports" activeClassName="active">Reports</NavLink></li>
          <li><NavLink to="/settings" activeClassName="active">Settings</NavLink></li>
        </ul>
      </nav>
    </aside>
  );
}

export default Sidebar;
